                      </button>
                    ) : (
                      <button
                        style={{
                          backgroundColor: "#3ccf4e",
                          border: "none",
                          padding: "10px 10px",
                          borderRadius: "5px",
                        }}
                      >
                        {" "}
                        <Link
                          onClick={(e) => {
                            dispatch(blockUser(dt?._id, keyword, dt?.userType));
                            setAlert(true);
                            setTimeout(() => {
                              setAlert(false);
                            }, 1500);
                          }}
                        >
                          {" "}
                          {dt?.isBlocked ? "unblock" : "block"}
                        </Link>
                      </button>
                    )}

                    <button
                      style={{
                        borderRadius: "50%",
                        width: "45px",
                        height: "45px",
                        backgroundColor: "#75E6FF",
                        border: "none",
                        marginLeft: "10px",
                      }}
                    >
                      {" "}
                      <Link to={`/user/publicView/${dt?._id}`}>
                        {" "}
                        <VisibilityIcon style={{ color: "white" }} />{" "}
                      </Link>
                    </button>

                    <button
                      style={{
                        borderRadius: "50%",
                        width: "45px",
                        height: "45px",
                        backgroundColor: '#333333',
                        border: "none",
                        marginLeft: "10px",
                      }}
                    >
                      {" "}
                      <Link to={`/user/publicView/${dt?._id}`}> <BookmarkIcon />  </Link>
                      
                    </button>
                  </div>
                </div>
              );
            })
          : ""}
    </div>
  )
}

export default BlackListed
